public class Program7 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// wap to print numbers which is completely divisible by 10 between 1 to 100.

		for (int i = 1; i <= 100; i++) {
			if (i % 10 == 0) {
				System.out.println(i);
			}
		}
	}

}
